import React from 'react'
import HomeIcon from '@material-ui/icons/Home';
import CheckIcon from '@material-ui/icons/Check';

export const SidebarData = [
    {
        title: "Home",
        icon: <HomeIcon />,
        url: "/home"
    },
    {
        title: "Statistics",
        icon: <HomeIcon />,
        url: "/home"
    },
    {
        title: "Team Management",
        icon: <CheckIcon />,
        url: "/team"
    },
    {
        title: "Patch Notes",
        icon: <HomeIcon />,
        url: "https://euw.leagueoflegends.com/fr-fr/news/tags/patch-notes"
    },
    {
        title: "Champions",
        icon: <HomeIcon />,
        url: "/home"
    },
    {
        title: "e-sport",
        icon: <HomeIcon />,
        url: "https://lolesports.com/"
    },
]
